import { observer } from "mobx-react-lite";
import { IconButton, View } from "native-base";
import React from "react";


 function UrgentList({filteredUrgent}) {
  return (
      <View>
      <IconButton onPress={filteredUrgent}>Urgent</IconButton>
    </View>
  );
}

export default observer(UrgentList);
